// 

import React, { useEffect, useState } from "react";
import {
  Box,
  Grid,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Switch,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
  Typography,
} from "@mui/material";
import { styled } from "@mui/material/styles";
import CloseIcon from "@mui/icons-material/Close";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import { Formik, Form, Field } from "formik";
import axios from "axios";
import InteviewPortal from "./InteviewPortal";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": { padding: theme.spacing(2) },
  "& .MuiDialogActions-root": { padding: theme.spacing(1) },
}));

const Categary = () => {
  const [checked, setChecked] = useState(true);
  const [open, setOpen] = useState(false);
  const [ini, setIni] = useState({ categoryName: "" });
  const [list, setList] = useState([]);
  const [editId, setEditId] = useState(null);
  const [serchcat, setSearchCat] = useState("");

  const handleChange = (event) => setChecked(event.target.checked);
  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = (values, { resetForm }) => {
    const url = editId
      ? `https://interviewback-ucb4.onrender.com/category/${editId}`
      : "https://interviewback-ucb4.onrender.com/category/create";
    const method = editId ? axios.patch : axios.post;
    
    method(url, values, {
      headers: { Authorization: "your_token_here" },
    })
      .then(() => {
        dataView();
        setIni({ categoryName: "" });
        setEditId(null);
        handleClose();
      })
      .catch(console.log);
    
    resetForm();
  };

  const dataView = () => {
    axios.get("https://interviewback-ucb4.onrender.com/category/", {
      headers: { Authorization: "your_token_here" },
    })
      .then((res) => setList(res.data.data))
      .catch(console.log);
  };

  const deleteData = (id) => {
    axios.delete(`https://interviewback-ucb4.onrender.com/category/${id}`, {
      headers: { Authorization: "your_token_here" },
    })
      .then(dataView)
      .catch(console.log);
  };

  const editData = (id, row) => {
    setIni(row);
    setEditId(id);
    handleClickOpen();
  };

  useEffect(dataView, []);

  return (
    <InteviewPortal>
      <Grid container spacing={2} alignItems="center">
        <Grid item xs={12} md={8}>
          <TextField
            label="Search Category"
            value={serchcat}
            fullWidth
            onChange={(e) => setSearchCat(e.target.value)}
          />
        </Grid>
        <Grid item xs={12} md={4}>
          <Button variant="contained" fullWidth onClick={handleClickOpen}>
            ADD CATEGORY
          </Button>
        </Grid>
      </Grid>
      
      <TableContainer component={Paper} sx={{ mt: 2, overflowX: "auto" }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>No.</TableCell>
              <TableCell align="center">Category Name</TableCell>
              <TableCell align="center">Status</TableCell>
              <TableCell align="center">Delete</TableCell>
              <TableCell align="center">Update</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list.map((row, i) => (
              <TableRow key={i}>
                <TableCell>{i + 1}</TableCell>
                <TableCell align="center">{row.categoryName}</TableCell>
                <TableCell align="center">
                  <Switch checked={checked} onChange={handleChange} />
                </TableCell>
                <TableCell align="center">
                  <IconButton onClick={() => deleteData(row._id)}>
                    <DeleteIcon color="error" />
                  </IconButton>
                </TableCell>
                <TableCell align="center">
                  <IconButton onClick={() => editData(row._id, row)}>
                    <EditIcon color="primary" />
                  </IconButton>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <BootstrapDialog onClose={handleClose} open={open}>
        <DialogTitle>
          {editId ? "Edit Category" : "Add Category"}
          <IconButton onClick={handleClose} sx={{ position: "absolute", right: 8, top: 8 }}>
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <Formik initialValues={ini} enableReinitialize onSubmit={handleSubmit}>
          <Form>
            <DialogContent dividers>
              <Field as={TextField} name="categoryName" label="Category" fullWidth />
            </DialogContent>
            <DialogActions>
              <Button type="submit" variant="contained">
                Submit
              </Button>
            </DialogActions>
          </Form>
        </Formik>
      </BootstrapDialog>
    </InteviewPortal>
  );
};

export default Categary;
